function textChunkAtPoint(p) {
    return this.textChunks
        .select(function(ea) { return  ea.style && ea.style.data && ea.style.data.type == 'word' })
        .detect(function(ea) {
        var r = ea.chunkNode.getBoundingClientRect()
        return p.x > r.left && p.x < r.right
            && p.y > r.top && p.y < r.bottom
    })
}

