function onMouseMove(evt) {
    var c = this.textChunkAtPoint(evt.getPosition().subPt($world.getScrollOffset()))
    if (!c) return;
    c.style.fontSize = (c.style.fontSize || 10) + (Math.random() - 0.3) *2 
}

